- input: "TEXT\x1CC00379545\x1C.TEXT\x1C\x1CF3XN\x1CThere has been an error, in either
    entry or with the software that has resulted in $50 donations being reported as
    $250 donations.  This occured in four separate quarters, and resulted in an overstatement
    of funds of $800.  However an additional error has been detected.  In this case
    $249 in two separate donations was not reported in Oct. 2006.    The two sets
    of errors resulted in an overstatement of funds of $551.   Using guidance from
    FEC staff and to reconcile actual receipts and expenditures, an amount of $551
    has been designated to account adjustment in line 21b."
